    false,nt"url": null,nt"notes": "This information is derived from inspections
    of restaurants and other food establishments in Chicago from January 1, 2010 to
    the present. Inspections are performed by staff from the Chicago Department of Public
    Healthu2019s Food Protection Program using a standardized procedure. The results
    of the inspection are inputted into a database, then reviewed and approved by a
    State of Illinois Licensed Environmental Health Practitioner (LEHP). For descriptions
    of the data elements included in this set, go to http://bit.ly/tS9IE8  rnDisclaimer:
    Attempts have been made to minimize any and all duplicate inspection reports. However,
    the dataset may still contain such duplicates and the appropriate precautions should
    be exercised when viewing or analyzing these data. The result of the inspections
    (pass, pass with conditions or fail) as well as the violations noted are based on
    the findings identified and reported by the inspector at the time of the inspection,
    and may not reflect the findings noted at other times. For more information about
    Food Inspections, go to http://bit.ly/tD91Sb.",nt"license_title": "License
